import React from 'react';
import '../../App.css';
import Cards from '../Cards';
import HeroSection from '../HeroSection';
import Footer from '../Footer';
import HomeAbout from '../HomeAbout';

function Home() {
  return (
    <>
      <HeroSection />
      <HomeAbout />

      <Cards />
      <Footer />
    </>
  );
}

export default Home;
